import "./App.css";

import axios from "axios";
import { useState } from "react";
import { useEffect } from "react";

function App() {
  const baseUrl = "http://localhost:50944/api/DCandidate";

  const [data, setData] = useState([]);

  const getRequest = async () => {
    await axios
      .get(baseUrl)
      .then((response) => {
        setData(response.data);
      })
      .catch((error) => {
        console.log(error);
      });
  };

  useEffect(() => {
    getRequest();
  });

  return (
    <div className="App">
      <br />
      <h3>Cadastro de Doação</h3>
      <header>
        <button className="btn btn-success">Adicionar novo cadastro</button>
      </header>
      <table class="table">
  <thead>
    <tr>
      <th scope="col">#</th>
      <th scope="col">Nome</th>
      <th scope="col">Telefone</th>
      <th scope="col">Tipo sanguíneo</th>
    </tr>
  </thead>
  <tbody>
    {data.map(DCandidate => (
      <tr key={DCandidate.id}>
        <td>{DCandidate.id}</td>
        <td>{DCandidate.fullName}</td>
        <td>{DCandidate.mobile}</td>
        <td>{DCandidate.bloodGroup}</td>
      </tr>
    ))}
  </tbody>
</table>
    </div>
  );
}

export default App;
